import React from 'react';
import './MainBackground.css'; // 해당 CSS 파일에서 배경 및 이미지 스타일을 정의

function MainBackground({ stage }) {
    return (
        <div className="backgroundContainer">
            <img src="main.png" alt="Main background" className="mainBackground" />
            {stage === 3 && <img src="man3.png" alt="Man 3" className="man3" />}
        </div>
    );
}

export default MainBackground;
